import React from "react";
import { BrowserRouter as Router, Switch, Route, Link } from "react-router-dom";
import styles from "../modules/Category.module.css";
import TldCategoryList from "./TldCategoryList.js";
import Emojis from "./Emojis.js";
import Names from "./Names.js";
import ThreeLetter from "./ThreeLetter.js";
import TwoLetter from "./TwoLetter.js";
import TopPicks from "./TopPicks.js";

export default function Category() {
  return (
    <div className={styles.container}>
      <Router>
        <Switch>
          <Route path="/tld" exact component={TldCategoryList} />
          <Route path="/category/emojis" component={Emojis} />
          <Route path="/category/topPicks" component={TopPicks} />
          <Route path="/category/names" component={Names} />
          <Route path="/category/threeLetter" component={ThreeLetter} />
          <Route path="/category/twoLetter" component={TwoLetter} />
        </Switch>
      </Router>
    </div>
  );
}
